export default {
  name: 'JnpfTextarea',
  props: {
    value: {
      type: [String, Number],
      default: ''
    },
    autoSize: {
      type: Object,
      default: () => { }
    },
  },
  data() {
    return {
      innerValue: ''
    };
  },
  watch: {
    value: {
      handler(val) {
        this.setValue(val);
      },
      immediate: true
    },
  },
  methods: {
    setValue(value) {
      this.innerValue = value;
    },
    onChange(value) {
      this.$emit('input', value);
    }
  }
};
